import React from 'react'

export const Button = () => {
  fetch(`http://127.0.0.1:8000/api/negocios`)
    .then(result => result.json())
    .then(negocios => this.setState({negocios: negocios.value}))
    console.log(negocios)
  return (
    <div>Button</div>
  )
}
